import axios from "axios";

export function GetCurrentOrder(orderId) {
    debugger;
    return async (orderId) => {
        let order = [];

        try {
            debugger;
            const response = await axios.get(`http://localhost:3001/api/orders/${orderId}`);
            if (response.data) {
                order = response.data;
            }

        } catch (error) {
            console.error('Error creating order:', error);
        }

        return order;
    }
}
